import React from 'react';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Button, StyleSheet, Text, View } from 'react-native';
const Login = () => {
    let value = {password:'test123',notes:[]};
    const storeData = async (value) => {
        try {
          const jsonValue = JSON.stringify(value)
          await AsyncStorage.setItem('test', jsonValue)
        } catch (e) {
          // saving error
        }
      }
      
const getData = async () => {
    try {
      const jsonValue = await AsyncStorage.getItem('test')
      return jsonValue != null ? console.log(JSON.parse(jsonValue)) : console.log('null');
    } catch(e) {
      // error reading value
    }
  }
  
    return (
        <view>
        <Text> in Login</Text>
        <Button title="store data" onPress={()=>{storeData(value)}}></Button>
        <Button title="show data" onPress={()=>{getData()}}></Button>
        </view>
    );
}
export default Login;
